                <?php

                function hrefFile($file){

                    return str_replace("\\",'/',"http://".$_SERVER['HTTP_HOST'].substr(getcwd(),strlen($_SERVER['DOCUMENT_ROOT']))."\\".$file);
                }

                function hrefMod($file){
                    return hrefFile("mod/".basename($file,".php")."_mod.php");
                }

                $html = "";
                include "globfile.php";
                $files = gamesfiles();
                $first = 0;
                $last = count($files)-1;
                foreach ($files as $file) {
                    if($file == $files[$first]){
                        $html .= "<ul id=\"games_created\" class=\"list-group\">";
                    }

                    $html .= "<li class=\"list-group-item link-games\"><a>".ucfirst(basename($file,".php"))."</a><button onclick=\"window.location.href='".hrefFile($file)."'\" class=\"btn btn-primary\" style=\"float: right;\">Â¡Jugar!</button><button onclick=\"window.location.href='".hrefMod($file)."'\" class=\"btn btn-secondary\" style=\"float: right;\">Modificar</button></li>";

                    if ($file == $files[$last]){
                        $html .= "</ul>";
                    }
                }

                echo $html;

                ?>
