<script src="https://maxcdn.bootstrapcdn.com/js/ie10-viewport-bug-workaround.js"></script>

<script>
    $(function() {
        $('body').bootstrapMaterialDesign();

        $('select').each(function(inex){
            var options = $(this).children().filter("option");
            var numOptions = options.length;
            var h = parseInt(options.first().css("height"));
            var padding_top = parseInt($(this).css("padding-top"));
            var padding_bottom = parseInt($(this).css("padding-bottom"));
            $(this).css("height", padding_top + h*numOptions + padding_bottom);
        });
    });
</script>

<div id="snackbar-container"></div>

<button type="button" class="btn2 btn-raised btn2-primary btn2-rounded waves-effect2 waves-light2 fixed-button"  data-toggle="modal" data-target="#myModalNorm">Crear un juego</button>



<div class="modal fade" id="myModalNorm" tabindex="-1" role="dialog"
     aria-labelledby="myModalLabel" aria-hidden="true">
    <div class="modal-dialog">
        <div class="modal-content">
            
            <div class="modal-header">
                <button type="button" class="close"
                        data-dismiss="modal">
                    <span aria-hidden="true">&times;</span>
                    <span class="sr-only">Close</span>
                </button>
                <h4 class="modal-title" id="myModalLabel">
                    Nuevo Juego
                </h4>
            </div>

            
            <div class="modal-body">

                <form role="form" id="create-game">
                    <div class="form-group">
                        <label for="inputNameGame">Nombre</label>
                        <input type="text" class="form-control"
                               id="inputNameGame" placeholder="Introduce el nombre del juego" required/>
                        <div class="invalid-feedback">
                            Introduce un nombre quÃ© SÃLO tenga nÃºmeros y letras.
                        </div>
                    </div>

                    <div class="modal-footer">
                        <button type="submit" class="btn btn-raised btn-lg btn-primary">Crear</button>
                    </div>
                </form>


            </div>
            
            
        </div>
    </div>
</div>
<script>
   
    (function() {
        'use strict';
        
        function isValid(input){
            return input.validity.valid && input.value.replace(/\s/g, "").length > 0 && /^[A-Za-z0-9 ]+$/.test(input.value)
        }

        var opt_error =  {
            content: "<i class='material-icons' role='presentation' style='float:left'>report_problem </i>",
            style: "toast",
            timeout: 2000,
            htmlAllowed: true,
        };
        var opt_success =  {
            content: "<i class='material-icons' role='presentation' style='float:left'>done_all</i> <div style='padding-left:30px'>Juego creado con Ã©xito</div>",
            style: "toast",
            timeout: 2000,
            htmlAllowed: true,
        };


        window.addEventListener('load', function() {
           

            var form = document.getElementById('create-game');
            var input = document.getElementById("inputNameGame");
            var input_mapa = {option: 1};
            var error = input.nextElementSibling;
           

            input.addEventListener("keyup", function (event) {
               
               
                if (isValid(input)) {
                   
                   
                   
                    error.className = "invalid-feedback";
                } else {
                   
                    error.className = "invalid-feedback active";
                }
            }, false);
            form.addEventListener("submit", function (event) {
                event.preventDefault();
               
               
                if (!isValid(input)) {
                   
                   
                    error.className = "invalid-feedback active";
                   
                    event.stopPropagation();
                } else {
                    $.ajax({
                        data: {"value" : input.value, "mapa": input_mapa.option},
                        type: "POST",
                        url: "valid.php",
                        timeout: 20000,
                        contentType: "application/x-www-form-urlencoded;charset=UTF-8",
                        statusCode: {
                            404: function() {
                                var opt_error2 = opt_error;
                                opt_error2.content ="<i class='material-icons' role='presentation' style='float:left'>report_problem </i>" + "<div style='padding-left:30px'>PÃ¡gina no encontrada</div>";
                                $.snackbar(opt_error2);
                            },
                            405: function(error) {
                                var opt_error2 = opt_error;
                                var response = error.responseText.split(" ||| ");
                                opt_error2.content ="<i class='material-icons' role='presentation' style='float:left'>report_problem </i>" + "<div style='padding-left:30px'>" + response[0] +"</div>";
                                $.snackbar(opt_error2);
                            },
                            406: function(error) {
                                var opt_error2 = opt_error;
                                opt_error2.content ="<i class='material-icons' role='presentation' style='float:left'>report_problem </i>" + "<div style='padding-left:30px'>" + error.responseText +"</div>";
                                $.snackbar(opt_error2);
                            }
                        },
                        success: function(response) {
                            var resp = response.split("|");
                            $.snackbar(opt_success);
                            $("#myModalNorm").modal('hide');
                            $("#games_created").append("<li class='list-group-item'> <a href='" + resp[0] + "'>"+ input.value + "</a> <button onclick=\"window.location.href='" + resp[1] + "'\" class=\"btn btn-secondary\" style=\"float: right;\">Modificar</button>");
                            form.reset();
                        },
                        error: function(xmlhttprequest, textstatus, message) {
                            var opt_error2 = opt_error;
                            if(textstatus==="timeout") {

                                opt_error2.content = "<i class='material-icons' role='presentation' style='float:left'>report_problem </i>" +  "<div style='padding-left:30px'>" + "Tiempo finalizado para conectarse" + "</div>";
                                $.snackbar(opt_error2);
                            } else {
                                opt_error2.content = "<i class='material-icons' role='presentation' style='float:left'>report_problem </i>" + "<div style='padding-left:30px'>" + textstatus + "</div>";
                                $.snackbar(opt_error2);

                            }
                        }
                    });

                    return false;
                }
            }, false);


            
        }, false);
    })();
</script>

